import "../styles/header.css";

class Header extends Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div id="navbar">
        <nav>
          <h1 className="navname">JUKEBOX</h1>
          <div className="rightside">
            <span className="score">Score: 0</span>
          </div>
        </nav>
      </div>
    );
  }
}

export default Header;
